import React, { Component } from "react";

class Card extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <>
        <div
          style={{
            display: "flex",
            flexDirection: "column",
            flex: 1,
            maxWidth: "252px",
            maxHeight: "284px",
            padding: "32px",
            borderRadius: "10px",
            boxShadow: "5px 5px 15px rgba(0, 0, 0, 0.15)",
          }}
        >
          <img src={require("../../assets/public.svg")} />
          <div>Public Q&A</div>
        </div>
      </>
    );
  }
}

export default Card;
